import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Head.css';

const Head = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const navigate = useNavigate();

    const handllogoClick = () => {
        console.log("Logo clicked");
        navigate('/portfolios');
    };

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    const handleMenuItemClick = (path) => {
        navigate(path);
        setIsMenuOpen(false); // Close the menu after navigation
    };

    const handlsidemenuClick = () => {
        console.log("Logo clicked");
        navigate('/sidemenu');
    };

    return (
        <header>
            <nav className="curve">
                <i 
                    className="bi bi-list" 
                    style={{ fontSize: "2rem", cursor: "pointer" }} 
                    onClick={toggleMenu}
                ></i>
                <img 
                    src="/logo.png" 
                    alt="ICA Logo" 
                    className="img-fluid mainlogo" 
                    onClick={handlsidemenuClick}
                />
                <i 
                    className="bi bi-person" 
                    style={{ fontSize: "2rem", color: "white" }} 
                ></i>
            </nav>
            
            {/* Side Menu */}
            {isMenuOpen && (
                <div className="side-menu">
                    <div className="side-menu-content">
                        <i 
                            className="bi bi-x" 
                            style={{ fontSize: "2rem", cursor: "pointer" }} 
                            onClick={toggleMenu}
                        ></i>
                        <div className="menu-header">
                            <img 
                                src="/profile-picture-placeholder.png" 
                                alt="Profile" 
                                className="profile-picture"
                            />
                            <h3>Arjun Patel</h3>
                        </div>
                        <ul className="menu-items">
                            <li onClick={() => handleMenuItemClick('/profile')}>Profile</li>
                            <li onClick={() => handleMenuItemClick('/')}>Home</li>
                            <li onClick={() => handleMenuItemClick('/scan-qr')}>Scan QR Code</li>
                            <li onClick={() => handleMenuItemClick('/sign-out')}>Sign Out</li>
                        </ul>
                        <div className="menu-footer">
                            <img 
                                src="/ica-logo.png" 
                                alt="ICA Logo" 
                                className="img-fluid"
                            />
                            <p>ITALIAN WOOD FINISHES</p>
                        </div>
                    </div>
                </div>
            )}
        </header>
    );
};

export default Head;
